import React from 'react';
import '../App.css';
import { Button } from './Button';
import './Contact.css';

function ContactSection() {
  return (
    <div className='contact-container'>
    <h1>Contact</h1>
    <br />
    <br />
      <div className='contact-text-container'>
      <p>Please contact me with any feedback on the projects or articles and if you are interested in working with in-fintech.</p>


      <br />
      <p>Email :  <a href="adhough@hotmail.com">adhough@hotmail.com</a></p>
      <br />
      <p>LinkedIn : <a href="www.linkedin.com/in/adrian-hough-528b7b">www.linkedin.com/in/adrian-hough-528b7b</a></p>
      <br />
      <p>twitter :  <a href="@adhough_London">@adhough_London</a></p>
      <br />

    </div>
    <br />
    <Button
      className='btns'
      buttonStyle='btn--outline'
      buttonSize='btn--large'
    >
      ABOUT
      </Button>
    </div>
  );
}

export default ContactSection;
